import axios from 'axios';

// Replace these constants with your actual Google Sheet ID and API key
const SHEET_ID = '1aj-xt9lKz8tux2LhaHjVDhjCT3TKlaf1xdoOjLKJxtU'; // Your Google Sheet ID
const API_KEY = 'AIzaSyCpQeGu5ttgs7nRF6bgTfK08CssTjkOAYI'; // Your Google Sheets API key
const RANGE = 'Betting%20Tips!A:AN'; // The dynamic range covering all rows in columns A to AN

export const fetchData = async () => {
  // Construct the URL for the Google Sheets API request
  const url = `https://sheets.googleapis.com/v4/spreadsheets/${SHEET_ID}/values/${RANGE}?key=${API_KEY}`;
  console.log('Fetching URL:', url); // Log the URL being fetched for debugging

  try {
    // Send a GET request to the Google Sheets API
    const response = await axios.get(url);
    console.log('API Response:', response); // Log the entire response object for debugging
    console.log('Data Values:', response.data.values); // Log the actual data values

    // Return the data values if the request was successful
    return response.data.values;
  } catch (error) {
    // Log any errors that occur during the request
    console.error('Error fetching data:', error);
    return [];
  }
};
